// SPDX-License-Identifier: Apache 2
pragma solidity ^0.8.7;

import "../interface/IWormhole.sol";
import "../structs/UnqWormholeStructs.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/beacon/BeaconProxy.sol";
import "./WormholeUnqBeacon.sol";
import "../libraries/BytesLib.sol";
import "../libraries/Bytes32Lib.sol";
import "../Treasury/UnqTreasury.sol";

pragma experimental ABIEncoderV2;

contract WormholeUnq is UnqWormholeStructs, Ownable {
    using BytesLib for bytes;
    using Bytes32Lib for bytes32;

    IWormhole core_contract;
    address _owner;
    WormholeUnqBeacon immutable _unqBeacon;
    mapping(bytes32 => address) _treasuries;
    mapping(uint16 => bytes32) _bridgeContracts;
    address _relayerSigner;

    uint256 immutable CHAIN_ID_PAD = 4;

    constructor(
        address treasuryImplementation,
        address relayerSigner,
        address wormholeBridgeContract
    ) {
        core_contract = IWormhole(wormholeBridgeContract);
        _owner = msg.sender;
        _unqBeacon = new WormholeUnqBeacon(treasuryImplementation);
        _relayerSigner = relayerSigner;
    }

    modifier onlyRegisteredContract(IWormhole.VM memory vm) {
        bytes32 registeredChain = _bridgeContracts[vm.emitterChainId];
        require(vm.emitterAddress == registeredChain, "Wrong emitter address");
        _;
    }

    event TreasuryCreatedEvent(bytes32, bytes32, address, address);
    event MemberEvent(bytes32, bytes32, address);

    function parseVM(bytes memory encodedVM) public {
        (
            IWormhole.VM memory vm,
            bool valid,
            string memory reason
        ) = core_contract.parseAndVerifyVM(encodedVM);

        require(valid, reason);

        getActionFromPayload(vm);
    }

    function registerContract(uint16 chainId, bytes32 bridgeContractAddress)
        public
        onlyOwner
    {
        _bridgeContracts[chainId] = bridgeContractAddress;
    }

    //TODO:add modifier for only registered contracts
    function getActionFromPayload(IWormhole.VM memory vm) private {
        uint8 actionBytes = uint8(vm.payload[0]);

        UnqWormholeAction action = UnqWormholeAction(actionBytes);
        if (action == UnqWormholeAction.CreateTreasury) {
            createEthTreasury(vm.payload);
        } else if (action == UnqWormholeAction.WithdrawFunds) {
            claimFunds(vm.payload);
        } else if (action == UnqWormholeAction.TransferFunds) {
            transferFunds(vm.payload);
        } else if (action == UnqWormholeAction.AddMember) {
            addMember(vm.payload);
        } else {
            revert("Unsupported UNQWormhole action");
        }
    }

    function createEthTreasury(bytes memory vm) public {
        uint256 index = CHAIN_ID_PAD + 1;
        bytes32 realmAddress = vm.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        bytes32 treasuryAuthority = vm.toBytes32(index);
        index += CHAIN_ID_PAD + 32;
        address denominatedCurrency = (vm.toBytes32(index)).bytes32ToAddress();

        BeaconProxy treasury = new BeaconProxy(
            address(_unqBeacon),
            abi.encodeWithSelector(
                UnqTreasury(payable(address(0))).initialize.selector,
                realmAddress,
                treasuryAuthority,
                denominatedCurrency,
                address(core_contract)
            )
        );

        emit TreasuryCreatedEvent(
            realmAddress,
            treasuryAuthority,
            denominatedCurrency,
            address(treasury)
        );

        _treasuries[realmAddress] = address(treasury);
    }

    function transferFunds(bytes memory payload) private {
        uint256 index = 1 + CHAIN_ID_PAD;
        bytes32 realmAddress = payload.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        address destination = (payload.toBytes32(index)).bytes32ToAddress();
        index += 32 + CHAIN_ID_PAD;
        uint256 amount = abi.decode(
            payload.slice(index, payload.length - 1),
            (uint256)
        );
        UnqTreasury treasury = UnqTreasury(_treasuries[realmAddress]);
        treasury.transferFunds(payable(destination), amount);
    }

    function claimFunds(bytes memory payload) private {
        uint256 index = 1 + CHAIN_ID_PAD;
        bytes32 solanaAddress = payload.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        address ethAddress = (payload.toBytes32(index)).bytes32ToAddress();
        index += 32 + CHAIN_ID_PAD;
        bytes32 realmAddress = payload.toBytes32(index);
        UnqTreasury treasury = UnqTreasury(_treasuries[realmAddress]);
        index += 32 + CHAIN_ID_PAD;
        uint256 amount = abi.decode(
            payload.slice(index, payload.length - 1),
            (uint256)
        );
        treasury.claimReward(solanaAddress, payable(ethAddress), amount);
    }

    function addMember(bytes memory payload) private {
        uint256 index = 0;
        uint8 action = payload.toUint8(index);
        index += 1 + CHAIN_ID_PAD;
        bytes32 realmAddress = payload.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        bytes32 solanaAddress = payload.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        bytes32 authority = payload.toBytes32(index);
        index += 32 + CHAIN_ID_PAD;
        address ethAddress = (payload.toBytes32(index)).bytes32ToAddress();
        index += 32 + CHAIN_ID_PAD;

        UnqTreasury treasury = UnqTreasury(_treasuries[realmAddress]);
        treasury.addNewMember(
            UnqWormholeStructs.AddMemberAction(
                action,
                realmAddress,
                solanaAddress,
                authority,
                ethAddress
            )
        );
        emit MemberEvent(realmAddress, solanaAddress, ethAddress);
    }

    function getBeacon() public view returns (address) {
        return address(_unqBeacon);
    }

    function getTreasury(bytes32 realmAddress)
        public
        view
        returns (address treasury)
    {
        return _treasuries[realmAddress];
    }

    function getOwner() public view returns (address) {
        return _owner;
    }
}
